gh (52 grams) contains 13.5 grams of protein. This is equal to 26 grams of protein per 100 grams (4).\n\nChicken thighs also have 109 calories per thigh, or 209 calories per 100 grams. 53% of the calories comes from protein, while 47% comes from fat (4).\n\nInterestingly, chicken thighs have a slightly darker color than chicken breast. This is because the chicken’s legs are more active and contain more myoglobin. This molecule helps provide active muscles with oxygen and also makes them redder (5Trusted Source).\n\nSome people find that the darkness of chicken thighs gives them a more succulent taste.\n\nSUMMARYOne chicken thigh contains 13.5 grams of protein, or 26 grams of protein per 100 grams. 53% of the calories in chicken thighs comes from protein, while 47% comes from fat.','Chicken thigh is another popular cut of meat that is slightly cheaper than chicken breast.\n\nOne skinless, boneless, cooked chicken thigh (52 grams) contains 13.5 grams of protein. This is equal to 26 grams of protein per 100 grams (4).\n\nChicken thighs also have 109 calories per thigh, or 209 calories per 100 grams. 53% of the calories comes from protein, while 47% comes from fat (4).\n\nInterestingly, chicken thighs have a slightly darker color than chicken breast. This is because the chicken’s legs are more active and contain more myoglobin. This molecule helps provide active muscles with oxygen and also makes them redder (5Trusted Source).\n\nSome people find that the darkness of chicken thighs gives them a more succulent taste.\n\nSUMMARYOne chicken thigh contains 13.5 grams of protein, or 26 grams of protein per 100 grams. 53% of the calories in chicken thighs comes from protein, while 47% comes from fat.','Bilaspur',NULL,'India',NULL,NULL,'Bilaspur',2454884.00,'94947979','public/case-document/pQ0uUdNZYs0ma7rk554INLSury99Kkm7CfDEZoEC.jpg','Approved',0.00,'2021-09-30',NULL,'2021-09-01 09:03:48','2021-09-01 11:31:34'),(72,39,8,'SEC 12327213','season','season','season','season','Omdu